function invoke(msg)         {

	var cachedval = parseFloat(msg.get("cachedRate"));
	var sellingrate = parseFloat(msg.get("currentRate"));
	var difference = 0; 
	if (cachedval > sellingrate) {
		difference = cachedval - sellingrate;
	} 
	else {
		difference = sellingrate - cachedval;
	}
	var perVal = (difference/ ((cachedval+sellingrate) /2)) * 100; 
	if (perVal > 2) {
		return true;
	}
	else {
		return false;
	}
}

var base64Import = new JavaImporter(java.util.Base64, java.nio.charset);

with(base64Import){
    function invoke(msg)
    {
        var id = msg.get("clientcredentialsid");
        var sec = msg.get("clientcredentialssecret");
        var cred = id + ":" + sec;
        var base64EncodedID = Base64.getEncoder().encodeToString(cred.getBytes(StandardCharsets.UTF_8));
        msg.put("data.creden", base64EncodedID);
        
        return true;
    }
};

