import java.util.Map;
import com.vordel.trace.Trace;
import com.vordel.kps.impl.KPS;
import com.vordel.mime.JSONBody;
import com.fasterxml.jackson.databind.ObjectMapper;
import groovy.transform.Field;

@Field def mapper = new ObjectMapper();
def invoke(msg)
{
	def appdata = msg.get("applicationdata");
	
	def store = KPS.getInstance().getStore("ClientQuotas"); // route -> KPS alias name
	def transaction = store.beginTransaction();
	
	def jsonNode = appdata.getJSON();
	def map = mapper.convertValue(jsonNode, Map.class);
	try{
		transaction.create(map);
		//to update
		//transaction.update(map);
	}
	catch(e){
		return false;
	}
	finally{
		transaction.close();
	}
	return true;
}

