with(imp) {
    function invoke(msg) {
               
        Trace.info("Script started");
        var data = msg.get("content.body");
        Trace.info('data length ' + data.getContentLength(0));
        Trace.info(typeof data);
        Trace.info('attachment' + '[' + data + ']' );

        var baos = new java.io.ByteArrayOutputStream(data.getContentLength(0));
        Trace.info('baos type ' + typeof baos);
        Trace.info('baos' + baos);

        data.writeContent(baos,0)
   
        var b64encoding =  DatatypeConverter.printBase64Binary(baos.toByteArray());
        Trace.info("byteArray created");

        msg.put("originalByteArray", b64encoding);
        Trace.info("originalByteArray added");

        return true;
    }
};

